Le solde du compte des administrations publiques est la différence entre les « _recettes publiques _»et les « _dépenses publiques » _au cours d’une période donnée\(mois, trimestre, année\). ^[Si les recettes sont supérieures aux dépenses, les administrations publiques jouiront d’une« _capacité de financement_ » \(surplus\) ; par contre, si les dépenses sont supérieures aux recettes, on parlera d’un « _besoin definancement_ » \(déficit\). ](inherit)^[Le secteur des administrations publiques comprend les sous\-secteurs du pouvoir fédéral, des communautés et régions, des administrations locales et des administrations desécurité sociale.^[
